import React from 'react';
import './Juniormun.css'

const Juniormun= () => {
    return (
        <>
        <div className="event-pic">
            <img src="https://nitsmun.in/img/munu18.jpg" alt="NITS Junior MUN" />
        </div>
        <div className="event-title">
            <h1>NITS Junior MUN</h1>
        </div>
        </>
    )
}

export default Juniormun
